          </Fragment>
        }
        link2={
          <Fragment>
            <span className="home-text218">Digital Wallet</span>
          </Fragment>
        }
        link4={
          <Fragment>
            <span className="home-text219">Phone</span>
          </Fragment>
        }
        cookiesLink={
          <Fragment>
            <span className="home-text220">Cookies Policy</span>
          </Fragment>
        }
        privacyLink={
          <Fragment>
            <span className="home-text221">Privacy Policy</span>
          </Fragment>
        }
      ></Footer4>
    </div>
    <Route path="/trillipay" element={<Trillipay />} />
          <Route path="/trillion bank" element={<TrillionBank />} />
          <Route path="/trifone" element={<Trifone />} />
          <Route path="/blokchain" element={<Blokchain />} />
          <Route path="/trillionit" element={<Trillionit />} />
    </Router>
  )
}

export default Home
